import React, { Component } from 'react';
//============================================================================//

class VehiclePicker extends Component {
  constructor() {
    super();
    this.state = {
    }
  }

  render() {
    const vehicles = [];
    for (const [index, value] of this.props.availableVehicles.entries()) {
      console.log(index, value);
      vehicles.push(
        <li style={{marginBottom: "10px"}}>
          <div>{value.Year} {value.Model} {value.Trim} {value.Engine}</div>
          <div>VIN: {value.Vin}</div>
          <button>Submit request for this vehicle</button>
        </li>
      )
    }
    return (
      <>
        <ul>
          {vehicles}
        </ul>
      </>
    )
  }



}

export default VehiclePicker;
